import React from "react";
import styled from "styled-components";

const Wrapper = styled.div``;

const InputType = styled.input`
  width: 315px;
  height: 60px;
`;

export default function InputText(subtext) {
  return (
    <Wrapper>
      <InputType />
    </Wrapper>
  );
}
